import {useState} from "react";
import "./Pages.css"
import portfolio from '../content/GAARTPortfolio.json'

function GAART(){
  console.log(portfolio[0].name)
  const [ports]=useState(portfolio)
console.log(ports)


  return (
    <div class="container" >
      <br></br>
      <div id="pageHeader" >
        <h1>GAART</h1>
        <p>Beginning sometime in 2013 I created a number of works of art dealing with the General Anti-Avoidance Rule (GAAR). It became known as GAART.</p>
      </div> 


          <ul className="list-group">
             { ports.map(port=>{

               return (

                 <div class="box">
               <li class="title" >{port.name}</li>
               <div class="list">
               <li class="hideBullet frame" ><img src={port.image} /></li>
               <li ><a href={port.link}>Read more here: {port.name}</a></li>
               <li >{port.size}</li>
               <li >{port.data}</li>
               <br></br>
                 </div>
                 </div>
               )
              })}

          </ul>
          <div><br></br></div>
      </div>
  )
}




export default GAART;
